import * as React from "react";

function SvgComp(props) {
  return <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 16 16" {...props}><path className="aw-theme-iconOutline" fill="#464646" d="M1 11.5l7-6.9 7 6.9-.5.5L8 5.4 1.5 12z" /></svg>;
}
        export const svgString = '<svg xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink"	 viewBox="0 0 16 16" xml:space="preserve"><polygon class="aw-theme-iconOutline" fill="#464646" points="1,11.5 8,4.6 15,11.5 14.5,12 8,5.4 1.5,12 "/></svg>';
        export const SvgComponent = React.memo(SvgComp);
